<html><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8"></head><body><b>状态代码</b><p>“状态代码”报告按 HTTP 协议的定义反映了访问者的状态。 要获得完整的 HTTP 定义状态代码列表，请在 Google 上搜索 <a href="http://www.google.com/search?q=http+1.1+status+code+definitions">http status code definitions（HTTP 状态代码定义）</a>.<p><p><%dic|default|507%><p>要比较两个时间范围，请点击蓝色“报告查看时间范围”标题栏上的 <img alt="Date Range Comparison" title="Date Range Comparison" src="/uicons/report/ccals.gif" border="0"> 图标。</body></html>
